import { Button, Form, Col, FormGroup, Checkbox } from 'react-bootstrap'
import { Column, Row } from 'simple-flexbox';


class Staff extends Component {

  constructor(props){
    super(props);

  }

  _isMounted=false;

  componentDidMount(){
   this._isMounted=true;
  }

  componentWillUnmount(){
    this._isMounted=false;
  }

  changeState(data){
    if(this._isMounted){
      this.setState(data)
    }
  }


  render() {
  	if(this.props.page === 'Staff'){
	    return (
	    	<div>

          <h1>Staff Configurations</h1>

          <Row>
            <p>Click on "Configure Settings" to change the banner in your Navigation Bar.</p>
          </Row>
          <Row>
            <Button onclick = {"hello"}>Configure Banner</Button> 
          </Row>

          <Row>
            <p>Click on "Configure Sheets" to configure and activate your workspace for use.</p>
          </Row>          
          <Row>
            <Button onclick = {"hello"}>Configure Sheets</Button> 
          </Row>

          <Row>
            <p>Click on "Configure Screenings" to screen partners and students in advance.</p>
          </Row>
          <Row>
            <Button onclick = {"hello"}>Configure Screenings</Button> 
          </Row>

		    </div>
	    )
		} else{
    	return null;
    }
  }

}


export default Staff;
